        - ПОСМОТРИТЕ ЭТО ПРИКОЛЬНОЕ ВИДЕО! КОЛЫБЕЛЬНЫЕ ХИТЫ! Какие песенки мы поем
        нашим малышам? Наталья: А моей дочурке безумно нравится песня "гляжу в озера
        синие..." Александра: А я своей девочке пою колыбельную Раймунда Паулса "Сонная
        песенка". (S). Татьяна: У меня дочка при первых звуках "спят усталые игрушки"
        заливалась ревом. 2Минусовка Спят усталые игрушки Детские Песни Текст песни.
        Спят усталые игрушки, книжки спят, Одеяла и подушки ждут ребят. Даже сказка
        спать ложится, Чтобы ночью нам присниться, Ты ей пожелай баю-бай. ... Спят
        твои соседи (из мультфильма Умка) ← Детские Песни. Танец маленьких утят ←
        Детские Песни. 3Минусовка Спят Усталые Игрушки Лолита Текст песни. Спят усталые
        игрушки, книжки спят, Одеяла и подушки ждут ребят. Даже сказка спать ложится,
        Чтобы ночью нам присниться. ... Ага ← Детские Песни. Маленькая Страна ← Наташа
        Королева. 4Спят усталые игрушки | ...кино и мультфильмов | Детские стишки,
        песенки... За печкою поет сверчок. Голубые глазки (Песня про внука). Самая
        счастливая. Мы запели песенку. Солнечный зайчик. Мы маленькие дети - нам хочется
